import React from "react";

const Navbar = ({ filterItem, menuList }) => {
  return (
    <>
      <nav className="navbar">
        <div className="btn-group">
          {menuList.map((currElem) => {
            return (
              <button
                className="btn-group__item"
                onClick={() => {
                  filterItem(currElem);
                }}
              >
                Breakfast
              </button>
            );
          })}
        </div>
      </nav>
    </>
  );
};

export default Navbar;
